CREATE TABLE gestalt_country (
    id SERIAL PRIMARY KEY,
    name_id INTEGER,
    iso2code TEXT,
    iso3code TEXT
);


CREATE TABLE gestalt_geography_name (
    id SERIAL PRIMARY KEY,
    name TEXT
);


CREATE TABLE gestalt_geography (
    id SERIAL PRIMARY KEY,
    name_id INTEGER,
    boundary_polygon FLOAT[][][],
    rectangle_polygon FLOAT[][][],
    hexagon_polygon FLOAT[][][],
    hexagon_center_x FLOAT,
    hexagon_center_y FLOAT
);


CREATE TABLE gestalt_subgroup (
    id SERIAL PRIMARY KEY,
    name_id INTEGER,
    group_id INTEGER,
    country_id INTEGER
);

